</span><br id="iu80hw"/>

<span id="iisyql">A. Have good scholastic standing as defined by the University. A student is in good scholastic standing if at the end of the semester s/he obtains a final grade of “3” or higher in at least 75% of the total number of academic units in which s/he is registered. (Faculty Manual, December 2003). Note: This requirement does not apply to freshmen applicants.
</span><br id="ikr717"/>

<span id="ivq2ck">B. Have an academic load of at least 15 units for undergraduate and 6 units for graduate students.
</span><br id="iijv6f"/>

<span id="i5n3i7">C. Additional requirement for those applying for readmission in the dorms: exhibited good behavior in their previous stay in the residence hall, i.e., did not violate any of the dorm guidelines.
